import React, {Component} from 'react';

export default class TaskButton extends Component {

        typeButton =()=>{
            const {className,testFun, id} = this.props;
            if(className === 'icon icon-edit'){
                return testFun(id, 'editing')
            } else {
                return testFun(id, 'del')
            }
        }

       render(){
        const {className} = this.props
        return  <button className={className} onClick={this.typeButton}></button>
    }
}
